import React from 'react'

function Home() {
    const styles = {
        h2: {
            fontFamily: "Roboto, sans-serif",
            fontSize: "30px"
        },
        h4: {
            fontFamily: "Roboto, sans-serif",
            fontSize: "40px",
            color: "olive"
        }
    }
    return (
        <header>
            <h2 style={styles.h2}>James</h2>
            <h4 style={styles.h4}>Lovell</h4>
            <div className="div--divider"/>
        </header>
    )
}

export default Home
